import React from 'react';
//import './css/App.css';
import Principal from './components/Principal';

function App() {
  return (
    <BrowserRouter>
        <Switch>
            <Route path="/" exact={true} component={App} />
            <Route path="/Principal" component={Sobre} />
        </Switch>
    </ BrowserRouter>
  );
}

export default App;
